// Gets the range for highlighing
function convertPCREMatchesToHighlightRanges(matchValues, group = 0) {
	//make a for look that gets the values targetIDom this array and converts then to an object like the below
	var arrayMatchObjects = [];
	for (let j = 0; j < matchValues.length; j++) {
		try {
			if (matchValues[j][group].start == null) {
				group = 0;
			}
		} catch (err) {
			//Group value was improprly set so we set it to 0 here because match 0 will always have soemthing
			group = 0;
		}
		var elementToPush = {
			start: matchValues[j][group].start,
			length: (matchValues[j][group].end - matchValues[j][group].start)
		};
		var objToPush = {
			elementToPush
		};
		if (elementToPush.length > 0) {
				arrayMatchObjects.push(elementToPush);
		}
	}
	return arrayMatchObjects;
}


