String.prototype.splice = function(index, string) {
  if (index > 0) {
    return this.substring(0, index) + string + this.substr(index);
  }

  return string + this;
};

function addSpansToHTML(markRangeInput){
  var trackerVal = 6;
  var tmpresult = document.getElementById('output').value;
  tmpresult = tmpresult.splice(markRangeInput[0].start, "<mark>");
  tmpresult = tmpresult.splice((markRangeInput[0].start+(markRangeInput[0].length)+trackerVal),"</mark>");
  trackerVal += 7;
  for(var i = 0 ; i < markRangeInput.length;i++){
    tmpresult = tmpresult.splice((markRangeInput[i].start+trackerVal), "<mark>");
    trackerVal += 6;
    tmpresult = tmpresult.splice((markRangeInput[i].start+(markRangeInput[i].length)+trackerVal),"</mark>");
    trackerVal += 7;
  }

  //console.log(tmpresult);
  tmpresult = escapeHtml(tmpresult);
  tmpresult = tmpresult.replaceAll("&lt;mark&gt;","<mark>");
  tmpresult = tmpresult.replaceAll("&lt;/mark&gt;","</mark>");
  //console.log(tmpresult);
  document.getElementById('output').innerHTML = (tmpresult);
}

// Replaces HTML Special Characters with their equivalanet code for display in text fields
function escapeHtml(text) {
	var map = {
		'&': '&amp;',
		'<': '&lt;',
		'>': '&gt;',
		'"': '&quot;',
		"'": '&#039;',
		"$": '&dollar;'
	};

	return text.replace(/[$<>"']/g, function(m) {
		return map[m];
	});
}

function openFileFromInput(event, file = document.getElementById("inputfile").value) {
	var input = event.target;
	var fr; // FileReader

	fr = new FileReader();
	fr.onload = function() {
		fileLoadUpdateDOM(fr.result);
	};

	try {
		fr.readAsText(input.files[0], "utf-8");
		uploadedFile = input.files[0]; // stores file so it can be reencoded later
	} catch (err) {
		console.error(err);
}
}

function fileLoadUpdateDOM(readerResult) {
	var result = readerResult;
	//sets the text of the element on the index.html
	document.getElementById('output').innerHTML = escapeHtml(result);
	document.getElementById('output').value = result;
	// Enables the parse button
}


